import Container from 'react-bootstrap/Container';
import Card from 'react-bootstrap/Card';

function Result(){

return(
<Container style={{margin:'0px', marginTop:'10px', marginLeft:'290px'}}>
<Card.Body style={{color:'white', textAlign:'center'}}>TU PERSONAJE ES</Card.Body><br></br>
        <Card style={{width:'700px', height:'500px', backgroundColor:'#e0e0e0', alignItems:'center', textAlign:'center'}}>
     <Card.Img variant="top" width='700px' height='400px' src={'image'} />
      <Card.Body>
        <Card.Title style={{fontSize:'7px'}}>{'name'}</Card.Title>
        </Card.Body>
        </Card>
    </Container>
)
}

export default Result;
